// JavaScript for n8n Code node

// Get input data (in n8n, usually use $input.all())
const items = $input.all();

// Define the list of prefixes to remove
const prefixesToRemove = ['Diane'];

// Process each item
const processedItems = items.map(item => {
  // Retrieve the message (adjust the field name according to your structure)
  let message = item.json.message || item.json.text || item.json.body;

  if (message && typeof message === 'string') {
    // Check each prefix and remove if it matches
    for (const prefix of prefixesToRemove) {
      // If the message starts with the prefix
      if (message.startsWith(prefix)) {
        // Remove the prefix
        message = message.substring(prefix.length);

        // If the next character is "„ÄÅ", remove it
        if (message.startsWith('„ÄÅ')) {
          message = message.substring(1);
        }

        // Exit loop after handling one prefix
        break;
      }
    }

    // Set the processed message
    return {
      json: {
        text: message.trim() // Also remove leading and trailing spaces
      }
    };
  }

  // If the message is not a string, return it as is
  return item;
});

return processedItems;
